import logo from './logo.svg';
import './App.css';
import Navbar from './component/navbar/Navbar';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Cart from './component/cart/Cart';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Router>
      <Switch>
        <Route path="/cart">
          <Cart />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
    </div>
  );
}

export default App;
